import React from "react";
import { connect } from "react-redux";
import { fetchStream } from "../../actions";

class StreamShow extends React.Component {

  componentDidMount() {
    this.props.fetchStream
  }

  render() {
    return <div>Stream Show</div>
  }
}

export default connect(
  null,
  { fetchStream }
)(StreamShow);
